public class LabIdentifier : ICompositeIdentifier\n{\n  public string Department { get; set; }\n  public int LabID { get; set; }\n\n  public override bool Equals(object obj)\n  {\n    var other = obj as LabIdentifier;\n    if (other == null) return false;\n    return Department == other.Department && LabID == other.LabID;\n  }\n\n  public override int GetHashCode()\n  {\n    unchecked\n    {\n      int hash = 17;\n      hash = hash * 23 + Department.GetHashCode();\n      hash = hash * 23 + LabID.GetHashCode();\n      return hash;\n    }\n  }\n}